__p += '\n\n\t<page-title ng-if="layoutOptions.pageTitles" title="File Upload" description="File uploading and processing via JavaScript plugins"></page-title>\n\n\n<h3 class="text-gray">\n\tDropzone <br />\n\t<small class="text-muted">DropzoneJS is an open source library that provides drag\'n\'drop file uploads with image previews.</small>\n</h3>\n\n<br />\n\n<div class="panel panel-default">\n\n\t<div class="panel-heading">\n\t\t<div class="panel-title">\n\t\t\tBasic Initialization\n\t\t</div>\n\t</div>\n\t\n\t<div class="panel-body">\n\t\t\n\t\t<!-- Auto initialization -->\n\t\t<form action="data/upload-file.php" class="dropzone"></form>\n\t\t\n\t</div>\n</div>\n\n\n<div class="panel panel-default">\n\n\t<div class="panel-heading">\n\t\t<h3 class="panel-title">\n\t\t\tCustom Configuration <small>using callback methods</small>\n\t\t</h3>\n\t</div>\n\t\n\t<div class="panel-body">\n\t\t\n\t\t<script type="text/javascript">\n\t\t\tjQuery(document).ready(function($)\n\t\t\t{\n\t\t\t\tvar i = 1,\n\t\t\t\t\t$example_dropzone_filetable = $("#example-dropzone-filetable"),\n\t\t\t\t\texample_dropzone = $("#advancedDropzone").dropzone({\n\t\t\t\t\turl: \'data/upload-file.php\',\n\t\t\t\t\t\n\t\t\t\t\t// Events\n\t\t\t\t\taddedfile: function(file)\n\t\t\t\t\t{\n\t\t\t\t\t\tif(i == 1)\n\t\t\t\t\t\t{\n\t\t\t\t\t\t\t$example_dropzone_filetable.find(\'tbody\').html(\'\');\n\t\t\t\t\t\t}\n\t\t\t\t\t\t\n\t\t\t\t\t\tvar size = parseInt(file.size/1024, 10);\n\t\t\t\t\t\tsize = size < 1024 ? (size + " KB") : (parseInt(size/1024, 10) + " MB");\n\t\t\t\t\t\t\n\t\t\t\t\t\tvar $entry = $(\'<tr>\\\n\t\t\t\t\t\t\t\t\t\t<td class="text-center">\'+(i++)+\'</td>\\\n\t\t\t\t\t\t\t\t\t\t<td>\'+file.name+\'</td>\\\n\t\t\t\t\t\t\t\t\t\t<td><div class="progress progress-striped"><div class="progress-bar progress-bar-warning"></div></div></td>\\\n\t\t\t\t\t\t\t\t\t\t<td>\'+size+\'</td>\\\n\t\t\t\t\t\t\t\t\t\t<td>Uploading...</td>\\\n\t\t\t\t\t\t\t\t\t</tr>\');\n\t\t\t\t\t\t\n\t\t\t\t\t\t$example_dropzone_filetable.find(\'tbody\').append($entry);\n\t\t\t\t\t\tfile.fileEntryTd = $entry;\n\t\t\t\t\t\tfile.progressBar = $entry.find(\'.progress-bar\');\n\t\t\t\t\t},\n\t\t\t\t\t\n\t\t\t\t\tuploadprogress: function(file, progress, bytesSent)\n\t\t\t\t\t{\n\t\t\t\t\t\tfile.progressBar.width(progress + \'%\');\n\t\t\t\t\t},\n\t\t\t\t\t\n\t\t\t\t\tsuccess: function(file)\n\t\t\t\t\t{\n\t\t\t\t\t\tfile.fileEntryTd.find(\'td:last\').html(\'<span class="text-success">Uploaded</span>\');\n\t\t\t\t\t\tfile.progressBar.removeClass(\'progress-bar-warning\').addClass(\'progress-bar-success\');\n\t\t\t\t\t},\n\t\t\t\t\t\n\t\t\t\t\terror: function(file)\n\t\t\t\t\t{\n\t\t\t\t\t\tfile.fileEntryTd.find(\'td:last\').html(\'<span class="text-danger">Failed</span>\');\n\t\t\t\t\t\tfile.progressBar.removeClass(\'progress-bar-warning\').addClass(\'progress-bar-red\');\n\t\t\t\t\t}\n\t\t\t\t});\n\t\t\t\t\n\t\t\t\t$("#advancedDropzone").css({\n\t\t\t\t\tminHeight: 200\n\t\t\t\t});\n\n\t\t\t});\n\t\t</script>\n\t\t\n\t\t<br />\n\t\t<div class="row">\n\t\t\t<div class="col-sm-3 text-center">\n\t\t\t\n\t\t\t\t<div id="advancedDropzone" class="droppable-area">\n\t\t\t\t\tDrop Files Here\n\t\t\t\t</div>\n\t\t\t\t\n\t\t\t</div>\n\t\t\t<div class="col-sm-9">\n\t\t\t\t\n\t\t\t\t<table class="table table-bordered table-striped" id="example-dropzone-filetable">\n\t\t\t\t\t<thead>\n\t\t\t\t\t\t<tr>\n\t\t\t\t\t\t\t<th width="1%" class="text-center">#</th>\n\t\t\t\t\t\t\t<th width="50%">Name</th>\n\t\t\t\t\t\t\t<th width="20%">Upload Progress</th>\n\t\t\t\t\t\t\t<th>Size</th>\n\t\t\t\t\t\t\t<th>Status</th>\n\t\t\t\t\t\t</tr>\n\t\t\t\t\t</thead>\n\t\t\t\t\t<tbody>\n\t\t\t\t\t\t<tr>\n\t\t\t\t\t\t\t<td colspan="5">Files list will appear here</td>\n\t\t\t\t\t\t</tr>\n\t\t\t\t\t</tbody>\n\t\t\t\t</table>\n\t\t\t\t\n\t\t\t</div>\n\t\t</div>\n\t\t\n\t</div>\n\n</div>\n';
