__p += '\n\n\t<page-title ng-if="layoutOptions.pageTitles" title="Update Highlights" description="News about the update and fixes in Xenon theme"></page-title>\n\n\n<div class="panel panel-headerless">\n\t<div class="panel-body">\n\n\t\t<ul class="highlights list-unstyled">\n\t\t\t<li class="version">\n\t\t\t\t<h4>VERSION 1.3</h4>\n\t\t\t</li>\n\t\t\t<li>\n\t\t\t\t<a href="dashboard-1.html" class="entry-img">\n\t\t\t\t\t<img src="assets/images/highlights/highlights-bootstrap-3-3-1.png" />\n\t\t\t\t</a>\n\n\t\t\t\t<div class="entry-description">\n\t\t\t\t\t<h3>Updated to Bootstrap 3.3.1</h3>\n\t\t\t\t\t<p>We love to be up to date, weve updated Xenon theme to the latest version of Bootstrap.</p>\n\t\t\t\t\t<p>Say hello to Bootstrap 3.3.1. As one of Boostrap fastest follow up releases, the changelog is focused around a small set of bug fixes for our CSS and JS, loads of accessibility improvements, and several documentation improvements.</p>\n\t\t\t\t</div>\n\t\t\t</li>\n\n\t\t\t<li>\n\t\t\t\t<a href="blank-sidebar-user-info-page.html" class="entry-img">\n\t\t\t\t\t<img src="assets/images/highlights/highlights-sidebar-user-info.png" />\n\t\t\t\t</a>\n\n\t\t\t\t<div class="entry-description">\n\t\t\t\t\t<h3>User Badge on Sidebar</h3>\n\t\t\t\t\t<p>This feature supports pop-up links related to user profile which is accessible when user clicks on the user thumbnail or name. It is optimised for mobile devices as well.</p>\n\t\t\t\t</div>\n\t\t\t</li>\n\n\t\t\t<li>\n\t\t\t\t<a href="dashboard-1.html" class="entry-img">\n\t\t\t\t\t<img src="assets/images/highlights/highlights-chat-footer.png" />\n\t\t\t\t</a>\n\n\t\t\t\t<div class="entry-description">\n\t\t\t\t\t<h3>Sticky Chat in Footer</h3>\n\t\t\t\t\t<p>Show recent chat conversations sticked in bottom of the page on the right side (or left side when sidebar is floated to right), inspired from the Facebook chat we integrated this feature with the request of our customers to have a better UX and UE.</p>\n\t\t\t\t</div>\n\t\t\t</li>\n\n\t\t\t<li>\n\t\t\t\t<a href="dashboard-1.html" class="entry-img">\n\t\t\t\t\t<img src="assets/images/highlights/highlights-language-switcher.png" />\n\t\t\t\t</a>\n\n\t\t\t\t<div class="entry-description">\n\t\t\t\t\t<h3>Language Switcher</h3>\n\t\t\t\t\t<p>Easily switch between the languages with the new language switcher in the top menu. Weve included this feature for those who use the theme for multi-lingual purposes.</p>\n\t\t\t\t</div>\n\t\t\t</li>\n\n\t\t\t<li>\n\t\t\t\t<a href="dashboard-1.html" class="entry-img">\n\t\t\t\t\t<img src="assets/images/highlights/highlights-fullscreen.png" />\n\t\t\t\t</a>\n\n\t\t\t\t<div class="entry-description">\n\t\t\t\t\t<h3>Full Screen Application</h3>\n\t\t\t\t\t<p>Allows expanding user screens to fullscreen for better experience in browsing and working with the application. This feature is only supported in Angular JS version.</p>\n\t\t\t\t</div>\n\t\t\t</li>\n\n\t\t\t<li>\n\t\t\t\t<a href="dashboard-1.html" class="entry-img">\n\t\t\t\t\t<img src="assets/images/highlights/highlights-members.png" />\n\t\t\t\t</a>\n\n\t\t\t\t<div class="entry-description">\n\t\t\t\t\t<h3>Members Page</h3>\n\t\t\t\t\t<p>New page for member management including profile edit link for members. It has tabs, so users can be categorized with roles or whatever you want to separate them.</p>\n\t\t\t\t</div>\n\t\t\t</li>\n\t\t</ul>\n\n\t</div>\n</div>\n\n\n<h3>Changelog</h3>\n\n<pre class="pre-line"># Dec 06, 2014 v 1.3\n\n* [Added] User profile with links in sidebar (Both - Plain & Angular version)\n* [Added] Chat conversation (secondary) sticked in footer (Both - Plain & Angular version)\n* [Added] Language switcher (at user info navbar) (Both - Plain & Angular version)\n* [Added] Members page (2 pages: list + add new member) (Both - Plain & Angular version)\n* [Added] Minified version of custom created Xenon JavaScript files located on: assets/js/min/\n* [Added] Full screen feature for Angular JS version\n\n* [Update] Bootstrap updated to v3.3.1\n* [Update] Updated scripts to latest version: Perfect Scrollbar,\n\n* [Fix] Mobile menu messed up on minimal navbar size (horizontal menu)\n* [Fix] Font weight on user info navbar fixed on firefox\n* [Fix] Empty stars icons on mailbox now appear properly\n* [Fix] Gallery placeholder when re-ordering images is added\n* [Fix] Missing "Login Light" template in Angular version\n* [Fix] Tabs active border appearing in newest Chrome version 39.0.X\n* [Fix] Tocify table of contents width appearing larger than container\n\n\n# Oct 15, 2014 v 1.2.1\n\n* [Fix] Mobile menu toggler now are working properly\n* [Fix] Issues with Angular Lazy Loading fixed\n\n\n# Oct 15, 2014 v 1.2\n\n* [Added] AngularJS version of Xenon Theme\n* [Fix] Bug fixes and code improvements\n\n\n# Oct 10, 2014 v 1.1\n\n* [Added] PSD Files of Xenon Layout (2 psd files)</pre><br />';
